Here is a sample CSS script that creates a scrolling effect:
```
.scroll-container {
  height: 200px;
  overflow-y: scroll;
}

.scroll-content {
  font-size: 24px;
  color: #333;
  animation: scroll 10s infinite linear;
}

@keyframes scroll {
  from {
    transform: translateY(0);
  }
  to {
    transform: translateY(-100%);
  }
}
```

